import{_ as a,a as r,b as i,c as t}from"./chunks/FMU_Debug_Port_Horizontal.CZlcrhnb.js";import{_ as o,c as l,a8 as s,o as n}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"Holybro Pix32 v5","description":"","frontmatter":{},"headers":[],"relativePath":"zh/flight_controller/holybro_pix32_v5.md","filePath":"zh/flight_controller/holybro_pix32_v5.md"}'),h={name:"zh/flight_controller/holybro_pix32_v5.md"};function d(p,e,c,u,m,b){return n(),l("div",null,e[0]||(e[0]=[s('<h1 id="holybro-pix32-v5" tabindex="-1">Holybro Pix32 v5 <a class="header-anchor" href="#holybro-pix32-v5" aria-label="Permalink to &quot;Holybro Pix32 v5&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><a href="https://holybro.com/products/pix32-v5" target="_blank" rel="noreferrer">Pix32 v5</a><sup>®</sup> is an advanced autopilot flight controller designed and made by Holybro<sup>®</sup>. It is optimized to run on PX4 firmware, which is intended for both academic and commercial developers. It is based on the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk-project</a> <strong>FMUv5</strong> open hardware design and runs PX4 on the <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS. It can be regarded as a variant version of Pixhawk4.</p><p>The Pix32 v5 is designed for pilots who need a high power, flexible and customisable flight control system. It is comprised of a separate flight controller and carrier (base) board, which are connected by a 100pin connector. This design allows users to either select a base board made by Holybro, or customize their own.</p><p><img src="'+a+'" alt="Pix32 v5 Family"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="总览" tabindex="-1">总览 <a class="header-anchor" href="#总览" aria-label="Permalink to &quot;总览&quot;">​</a></h2><ul><li>主处理器：STM32F765 <ul><li>32 位 Arm® Cortex®-M7，216MHz，2MB 储存，512KB RAM</li></ul></li><li>IO 处理器：STM32F100 <ul><li>32 位 Arm® Cortex®-M3，24MHz，8KB SRAM</li></ul></li><li>内置传感器： <ul><li>加速度计 / 陀螺仪：ICM-20689</li><li>Accel/Gyro: BMI055 or ICM20602</li><li>磁力计：IST8310</li><li>气压计：MS5611</li></ul></li><li>GPS：ublox Neo-M8N GPS/GLONASS 接收器；集成磁力计 IST8310</li><li>接口： <ul><li>8-16 路PWM输出（8路来自 IO，8路来自 FMU）</li><li>FMU上有3个专用PWM/Capture输入</li><li>CPPM专用的RC输入</li><li>用于 Spektrum / DSM 与 有模拟 / PWM RSSI 的 S.Bus 的专用遥控输入</li><li>Dedicated S.Bus servo output</li><li>5个通用串行口 <ul><li>2 with full flow control</li><li>1 with separate 1.5A current limit</li></ul></li><li>3 个 I2C 接口</li><li>4路SPI总线 <ul><li>1 internal high speed SPI sensor bus with 4 chip selects and 6 DRDYs</li><li>1 internal low noise SPI bus dedicated for</li><li>Barometer with 2 chip selects, no DRDYs</li><li>1 internal SPI bus dedicated for FRAM</li><li>Supports dedicated SPI calibration EEPROM located on sensor module</li><li>1 external SPI buses</li></ul></li><li>多达 2 路 CAN 总线用于带串口的电调 <ul><li>Each CANBus has individual silent controls or ESC RX-MUX control</li><li>2个电池电流/电压模拟输入口</li><li>2 additional analog inputs</li></ul></li></ul></li><li>Electrical System: <ul><li>电源模块输出：4.9~5.5V</li><li>Max input voltage: 6V</li><li>最大电流感应：120A</li><li>USB 电源输入：4.75~5.25V</li><li>伺服导轨输入电压：0~36V</li></ul></li><li>重量和尺寸: <ul><li>Dimensions: 45x45x13.5mm</li><li>Weight: 33.0g</li></ul></li><li>Environmental Data, Quality &amp; Reliability: <ul><li>工作温度：-40 ~ 85°C</li><li>Storage temp. -40~85℃</li><li>CE</li><li>FCC</li><li>RoHS compliant (lead-free)</li></ul></li></ul><p>Additional information can be found in the <a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5_technical_data_sheet_v1.1.pdf" target="_blank" rel="noreferrer">Pix32 V5 Technical Data Sheet</a>.</p><h2 id="购买渠道" tabindex="-1">购买渠道 <a class="header-anchor" href="#购买渠道" aria-label="Permalink to &quot;购买渠道&quot;">​</a></h2><p>Order from <a href="https://holybro.com/products/pix32-v5" target="_blank" rel="noreferrer">Holybro website</a>.</p><h2 id="组装-设置" tabindex="-1">组装 / 设置 <a class="header-anchor" href="#组装-设置" aria-label="Permalink to &quot;组装 / 设置&quot;">​</a></h2><p>The <a href="./../assembly/quick_start_holybro_pix32_v5.html">Pix32 v5 Wiring Quick Start</a> provides instructions on how to assemble required/important peripherals including GPS, Power Management Board etc.</p><h2 id="base-board-layouts" tabindex="-1">Base Board Layouts <a class="header-anchor" href="#base-board-layouts" aria-label="Permalink to &quot;Base Board Layouts&quot;">​</a></h2><p><img src="'+r+'" alt="Pix32 v5 Image"></p><h2 id="针脚定义" tabindex="-1">针脚定义 <a class="header-anchor" href="#针脚定义" aria-label="Permalink to &quot;针脚定义&quot;">​</a></h2><p><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_Pix32-V5-Base-Mini-Pinouts.pdf" target="_blank" rel="noreferrer"><em>pix32 v5</em> and mini baseboard</a></p><h2 id="尺寸" tabindex="-1">尺寸 <a class="header-anchor" href="#尺寸" aria-label="Permalink to &quot;尺寸&quot;">​</a></h2><p><img src="'+i+'" alt="Pix32 v5 Image"></p><h2 id="额定电压" tabindex="-1">额定电压 <a class="header-anchor" href="#额定电压" aria-label="Permalink to &quot;额定电压&quot;">​</a></h2><p><em>Pix32 v5</em> can be triple-redundant on the power supply if three power sources are supplied. The three power rails are: <strong>POWER1</strong>, <strong>POWER2</strong> and <strong>USB</strong>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The output power rails <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 36V) do not power the flight controller board (and are not powered by it). You must supply power to one of <strong>POWER1</strong>, <strong>POWER2</strong> or <strong>USB</strong> or the board will be unpowered.</p></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>Under these conditions all power sources will be used in this order to power the system:</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (4.9V to 5.5V)</li><li><strong>USB</strong> input (4.75V to 5.25V)</li></ol><p><strong>Absolute Maximum Ratings</strong></p><p>Under these conditions the system will not draw any power (will not be operational), but will remain intact.</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (operational range 4.1V to 5.7V, 0V to 10V undamaged)</li><li><strong>USB</strong> input (operational range 4.1V to 5.7V, 0V to 6V undamaged)</li><li>Servo input: VDD_SERVO pin of <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 42V undamaged)</li></ol><h2 id="编译固件" tabindex="-1">编译固件 <a class="header-anchor" href="#编译固件" aria-label="Permalink to &quot;编译固件&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_pix32v5_default</span></span></code></pre></div><h2 id="调试接口" tabindex="-1">调试接口 <a class="header-anchor" href="#调试接口" aria-label="Permalink to &quot;调试接口&quot;">​</a></h2><p>The system&#39;s <a href="./../debug/system_console.html">serial console</a> and SWD interface runs on the <strong>FMU Debug</strong> port</p><p><img src="'+t+'" alt="FMU debug port diagram"></p><p>The pinout uses the standard <a href="./../debug/swd_debug.html#pixhawk-debug-mini">Pixhawk Debug Mini</a> interface defined in the <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a>.</p><h2 id="外部设备" tabindex="-1">外部设备 <a class="header-anchor" href="#外部设备" aria-label="Permalink to &quot;外部设备&quot;">​</a></h2><ul><li><a href="./../sensor/airspeed.html">Digital Airspeed Sensor</a></li><li><a href="./../telemetry/">Telemetry Radio Modules</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="支持的平台-机身" tabindex="-1">支持的平台/机身 <a class="header-anchor" href="#支持的平台-机身" aria-label="Permalink to &quot;支持的平台/机身&quot;">​</a></h2><p>Any multicopter / airplane / rover or boat that can be controlled with normal RC servos or Futaba S-Bus servos. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="附加信息" tabindex="-1">附加信息 <a class="header-anchor" href="#附加信息" aria-label="Permalink to &quot;附加信息&quot;">​</a></h2><ul><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5_technical_data_sheet_v1.1.pdf" target="_blank" rel="noreferrer">Pix32 v5 Technical Data Sheet</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_Pix32-V5-Base-Mini-Pinouts.pdf" target="_blank" rel="noreferrer">Pix32 v5 Pinouts</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5-BASE-Schematic_diagram.pdf" target="_blank" rel="noreferrer">Pix32 v5 Base Board Schematic Diagram</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5-Base-Mini-Board_Schematic_diagram.pdf" target="_blank" rel="noreferrer">Pix32 v5 Mini Base Board Schematic Diagram</a></li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a>.</li></ul>',42)]))}const _=o(h,[["render",d]]);export{P as __pageData,_ as default};
